5	Qu normas establezco para mis huspedes?	2	<ol>\r\n\t<li>The host determines at all times who and when they can stay at home.</li>\r\n\t<li>Like every house, yours has its norms of coexistence. Write them and communicate them to the guests so that they know how they can feel comfortable and without inconveniences. Clear accounts .. retain happy guests.</li>\r\n\t<li>At the entrance, when you show him the property, tell him the things that are important to you.</li>\r\n\t<li>Show him how the equipment works and where the electrical outlets are with their voltage values (they must be signaled).</li>\r\n\t<li>If you have valuables, put them on a list and sign them.</li>\r\n\t<li>You must ensure that all guests and companions are properly registered, taking the passport and identity card as appropriate and according to the regulations established for that purpose.</li>\r\n</ol>	What rules do I set for my guests?	<ol>\r\n\t<li>El anfitri&oacute;n determina en cada momento qui&eacute;n y cu&aacute;ndo pueden alojarse en su casa.</li>\r\n\t<li>Como toda casa, la tuya tiene sus normas de convivencia. Escr&iacute;belas y comun&iacute;calas a los hu&eacute;spedes para que sepan c&oacute;mo se pueden sentir c&oacute;modos y sin inconvenientes. Cuentas claras.. conservan hu&eacute;spedes contentos.</li>\r\n\t<li>En la entrada, cuando le muestras el inmueble, ind&iacute;cales las cosas que son importantes para ti.</li>\r\n\t<li>Mu&eacute;strale como funcionan los equipos y d&oacute;nde se encuentran las tomas de corriente el&eacute;ctrica con sus valores de voltaje (deben estar se&ntilde;alizados).</li>\r\n\t<li>Si tienes objetos de valor, ponlos en una lista y que lo firmen.</li>\r\n\t<li>Debes garantizar que todos los hu&eacute;spedes y acompa&ntilde;antes est&eacute;n debidamente registrados, tomando los datos de pasaporte y carn&eacute; de identidad seg&uacute;n el caso y de acuerdo a las regulaciones establecidas al efecto</li>\r\n</ol>
9	Solicitud	1	<p>Request by the owner the Lease License in the Municipal Housing Department in which the property is located. Documents to submit:</p>\r\n\r\n<p>a) title that proves ownership of the home;</p>\r\n\r\n<p>b) certification issued by the labor entity on its bank debt, in the case of workers who cease their work;</p>\r\n\r\n<p>c) document proving representation, if applicable; Y</p>\r\n\r\n<p>d) stamps of the stamp for a total value of ten pesos.</p>\r\n\r\n<p>The acting official receives the documents referred to above and takes an Affidavit (Annex No. 1), stating:</p>\r\n\r\n<p>a) the general information of the owner (s): names and surnames, age, marital status, permanent identity number, work center, profession or trade;</p>\r\n\r\n<p>b) references on the Title of Property and address of the dwelling;</p>\r\n\r\n<p>c) object of the lease.</p>\r\n\r\n<p>If you intend to rent the house in its entirety, the amount of rooms you own is recorded. If you intend to lease spaces, your name. If you request to rent rooms the amount of these is declared. Whenever you have a pool, your area is reflected in square meters;</p>\r\n\r\n<p>d) type of currency in which it is requested to operate, in correspondence with the authorized modalities (for foreign and national tourists - CUC);</p>\r\n\r\n<p>e) if a lease of the complete home is requested, the address where the lessors will reside; Y</p>\r\n\r\n<p>f) signature of the owner. If there are co-owners it is required that the Affidavit be signed by all. The official gives the interested parties the acknowledgment of receipt of the documents received, which also reflects the date on which they can go to the corresponding office to notify them of the result of the request in process.</p>	Request	<p>Solicitar por parte del propietario la Licencia de Arrendamiento en la Direcci&oacute;n Municipal de la Vivienda en que se encuentra enclavado el inmueble. Documentos a presentar:</p>\r\n\r\n<p>a) t&iacute;tulo que acredita la propiedad de la vivienda;</p>\r\n\r\n<p>b) certificaci&oacute;n emitida por la entidad laboral sobre su deuda bancaria, en el supuesto de los trabajadores que cesen en su actividad laboral;</p>\r\n\r\n<p>c) documento que acredite la representaci&oacute;n, en su caso; y</p>\r\n\r\n<p>d) sellos del timbre por valor total de diez pesos.</p>\r\n\r\n<p>El funcionario actuante recepciona los documentos referidos anteriormente y toma <strong>Declaraci&oacute;n Jurada</strong> (Anexo No. 1), en la que hace constar:</p>\r\n\r\n<p>a) los datos generales del o los propietarios: nombres y apellidos, edad, estado civil, n&uacute;mero de identidad permanente, centro de trabajo, profesi&oacute;n u oficio;</p>\r\n\r\n<p>b) referencias sobre el T&iacute;tulo de Propiedad y direcci&oacute;n de la vivienda;</p>\r\n\r\n<p>c) objeto del arrendamiento.</p>\r\n\r\n<p>Si se pretende arrendar la vivienda en su totalidad, se consigna cantidad de habitaciones que posee. Si se pretende arrendar espacios, su denominaci&oacute;n. Si se solicita arrendar habitaciones se declara la cantidad de estas. Siempre que tenga piscina se refleja su &aacute;rea en metros cuadrados;</p>\r\n\r\n<p>d) tipo de moneda en que se solicita operar, en correspondencia con las modalidades autorizadas (para turistas extranjeros y nacionales - CUC);</p>\r\n\r\n<p>e) si se solicita arrendamiento de la vivienda completa, el domicilio donde residir&aacute;n los arrendadores; y</p>\r\n\r\n<p>f) firma del propietario. Si existen copropietarios se requiere que la Declaraci&oacute;n Jurada sea firmada por todos. El funcionario entrega a los interesados Acuse de Recibo de los documentos recibidos, donde refleja, adem&aacute;s, la fecha en la que puede acudir a la Oficina correspondiente a notificarse del resultado de la solicitud en tr&aacute;mite.</p>
