13	Las casas particulares tienen varias ventajas sobre otros tipos de hospedaje:	4	<ol>\r\n\t<li>Clients can quickly develop friendly relationships with the owners of the house, as well as deeply involved in the culture of the country. Before the tourist realizes, will be considered part of the family with which he is staying.</li>\r\n\t<li>The guest, usually enjoy a pure, free, quiet atmosphere, feels at home, and can invite more friends.</li>\r\n\t<li>Private Houses are much cheaper than hotels.</li>\r\n\t<li>By renting a private home, clients directly contribute to improving the standard of living of a Cuban person or family.</li>\r\n</ol>	Private homes have several advantages over other types of lodging	<ol>\r\n\t<li>Los clientes pueden desarrollar r&aacute;pidamente relaciones de amistad con los propietarios de la casa, adem&aacute;s de que se involucran profundamente en la cultura del pa&iacute;s. Antes de que el turista se de cuenta, ser&aacute; considerado parte de la familia con la cual se esta hospedando.</li>\r\n\t<li>El hu&eacute;sped, por lo general disfrutan de una atm&oacute;sfera pura, libre, tranquila, se siente como en su propia casa, y podr&aacute; invitar a m&aacute;s amigos.</li>\r\n\t<li>Las Casas particulares son mucho m&aacute;s econ&oacute;micas que los hoteles.</li>\r\n\t<li>Al alquilar una casa particular, los clientes contribuyen directamente a mejorar el nivel de vida de una persona o familia cubana.<br />\r\n\t&nbsp;</li>\r\n</ol>
1	Viajar a Cuba	5	<p>When traveling to Cuba, it is very important that all our visitors know a series of customs and immigration regulations that must be met at the time of arrival in our country. In this section of our website you will find some indications, information and tips that we provide to make the visa, customs, etc. procedures easier.</p>	Travel to Cuba	<ol>\r\n\t<li>A la hora de viajar a Cuba, es muy importante que todos nuestros visitantes conozcan una serie de regulaciones aduanales y de inmigraci&oacute;n que deben cumplir a la hora de su arribo a nuestro pa&iacute;s. En esta secci&oacute;n de nuestra Web podr&aacute;n encontrar algunas indicaciones, informaciones y consejos que brindamos para hacer m&aacute;s f&aacute;cil los tr&aacute;mites de visado, de aduanas, etc</li>\r\n</ol>
7	Cmo comunicarme con los huspedes?	2	<p>You can exchange messages with guests through our website or communicate with our Team in case you lack some relevant information for your reception upon arrival and it is difficult for you to communicate directly with the guest.</p>	How to communicate with guests?	<p>Puedes intercambiar mensajes con los hu&eacute;spedes a trav&eacute;s de&nbsp; nuestro sitio web o&nbsp;te comunicas con nuestro Equipo en caso que te falte alguna informaci&oacute;n relevante para su recibimiento a su arribo y te sea dif&iacute;cil la comunicaci&oacute;n directa con el hu&eacute;sped.</p>
18	Corriente elctrica en Cuba	4	<p>In Cuba the electrical fluid is used at 110 volts and the plugs are spigot (flat). However, private homes and hotels have a 220 volt outlet and round plugs for tourists to carry their cell phone (mobile) or use the razor.</p>	Electric current in Cuba	<p>En Cuba se usa el fluido el&eacute;ctrico a 110 voltios y los enchufes son de espiga (planos). No obstante las casas particulares y hoteles tienen toma de 220 voltios y enchufes redondos para que los turistas carguen el celular (m&oacute;vil) o usen la maquinilla de afeitar.<br />\r\n&nbsp;</p>
19	Amabilidad y seguridad en Cuba	4	<ul>\r\n\t<li>The people in Cuba are very happy, educated and kind. It is common to listen to music everywhere and that a couple of steps dance (salsa) even in the street itself. Time goes slower in Cuba, people are not in a hurry, nor are they punctual.</li>\r\n\t<li>Although Cuba is considered a very safe country for tourists, you should take the usual security measures in any unknown country and especially not stay in an unauthorized house. Remember that what is allowed in your country may not be allowed in Cuba.</li>\r\n</ul>	Friendliness and security in Cuba	<ul>\r\n\t<li>La gente en Cuba es muy alegre, educada y amable. Es frecuente escuchar m&uacute;sica en todas partes y que una pareja de unos pasos de baile (salsa) hasta en la propia calle. El tiempo va m&aacute;s despacio en Cuba, la gente no tiene prisa, tampoco es puntual.</li>\r\n\t<li>Aunque Cuba es considerado un pa&iacute;s muy seguro para el turista, debes tomar las habituales medidas de seguridad en cualquier pa&iacute;s desconocido&nbsp;y sobre todo no alojarte en una casa no autorizada. Recuerda que lo permitido en tu pa&iacute;s puede no estar permitido en Cuba.<br />\r\n\t&nbsp;</li>\r\n</ul>
20	General	6	<p>This Privacy Policy establishes the terms in which BookingQBA uses and protects the information that is provided by its users when using your website. This company is committed to the security of its users&#39; data. When we ask you to fill in the fields of personal information with which you can be identified, we do so by ensuring that it will only be used in accordance with the terms of this document. However, this Privacy Policy may change over time or be updated for what we recommend and we strongly encourage you to continually review this page to ensure that you agree to such changes.</p>	General	<p>La presente Pol&iacute;tica de Privacidad establece los t&eacute;rminos en que BookingQBA usa y protege la informaci&oacute;n que es proporcionada por sus usuarios al momento de utilizar su sitio web. Esta compa&ntilde;&iacute;a est&aacute; comprometida con la seguridad de los datos de sus usuarios. Cuando le pedimos llenar los campos de informaci&oacute;n personal con la cual usted pueda ser identificado, lo hacemos asegurando que s&oacute;lo se emplear&aacute; de acuerdo con los t&eacute;rminos de este documento. Sin embargo esta Pol&iacute;tica de Privacidad puede cambiar con el tiempo o ser actualizada por lo que le recomendamos y enfatizamos revisar continuamente esta p&aacute;gina para asegurarse que est&aacute; de acuerdo con dichos cambios.</p>
21	Informacin que es recogida	6	<p>Our website may collect personal information such as: name, contact information such as your email address and demographic information. Also when necessary, specific information may be required to process an order or make a delivery or billing.</p>	Information that is collected	<p>Nuestro sitio web podr&aacute; recoger informaci&oacute;n personal por ejemplo: nombre,&nbsp;informaci&oacute;n de contacto como&nbsp; su direcci&oacute;n de correo electr&oacute;nica e informaci&oacute;n demogr&aacute;fica. As&iacute; mismo cuando sea necesario podr&aacute; ser requerida informaci&oacute;n espec&iacute;fica para procesar alg&uacute;n pedido o realizar una entrega o facturaci&oacute;n.</p>
14	El tiempo en Cuba - Cmo vestir para ir a Cuba	4	<ul>\r\n\t<li>Cuba is a country geographically located in the Tropic of Cancer line, therefore, with a mild tropical climate. The whole year is hot and you can go short sleeves, in the months of January and February, someday you may need a jacket in the afternoon or evening. The sea water is always warm or warm.</li>\r\n\t<li>Havana is the city that has the driest and temperate climate. The further east (Santiago de Cuba) the climate is warmer.</li>\r\n\t<li>Therefore, it is recommended to dress in light, summer clothes, cotton fabrics, and shorts. For the feet, sandals. Do not forget to bring your sunglasses and a protective cream if you go to the beach.</li>\r\n\t<li>If you go to the movies, to the theater or to the ballet; In Cuba it is forbidden to wear shorts or a sleeveless shirt. The same can happen to go to restaurants and other public places.</li>\r\n</ul>	Weather in Cuba - How to dress to go to Cuba	<ul>\r\n\t<li>Cuba es un pa&iacute;s geogr&aacute;ficamente situado en la l&iacute;nea del tr&oacute;pico de C&aacute;ncer, por lo tanto, de clima tropical suave. Todo el a&ntilde;o hace calor y se puede ir de manga corta, en los meses de enero y febrero, alg&uacute;n d&iacute;a puede necesitarse una chaqueta por la tarde o noche. El agua del mar siempre es c&aacute;lida o templada.</li>\r\n\t<li>La Habana es la ciudad que tiene el&nbsp;clima m&aacute;s seco y templado. Cuanto m&aacute;s al este (Santiago de Cuba) el clima es m&aacute;s c&aacute;lido.</li>\r\n\t<li>As&iacute;&nbsp;pues, se recomienda vestir con ropa ligera, veraniega, tejidos de algod&oacute;n, y pantal&oacute;n corto. Para los pies, sandalias. No olvide llevar sus gafas de sol y una crema protectora si va a la playa.</li>\r\n\t<li>Si va al cine, al teatro o al ballet;&nbsp;en Cuba est&aacute;&nbsp;prohibido ir con pantal&oacute;n corto o en camiseta sin mangas. Lo mismo puede pasar para ir a restaurantes y otros lugares p&uacute;blicos.</li>\r\n</ul>
16	Transporte entre ciudades:	4	<ul>\r\n\t<li>Between cities, you can rent a &quot;car&quot; or &quot;car&quot;, a car, which in Cuba are expensive, it is cheaper to rent them from the country of origin.</li>\r\n\t<li>In high season, the number of rental cars usually runs out, so you can use the bus transportation from the company Viazul.</li>\r\n\t<li>There are buses for Cubans, simpler, from the company Astro and are paid in Cuban pesos.</li>\r\n\t<li>Given that the roads of Cuba are full of bicycles and animals, we recommend you to exercise caution when driving a rental car and to value the convenience of using a car with a driver.</li>\r\n</ul>	Transportation between cities	<ul>\r\n\t<li>Entre ciudades, puede alquilar un &quot;carro&quot; o &quot;coche&quot;, un autom&oacute;vil, que en Cuba son caros, es m&aacute;s econ&oacute;mico alquilarlos desde el pa&iacute;s de origen.</li>\r\n\t<li>En temporada alta suelen agotarse el n&uacute;mero de autos de alquiler, por lo que se puede recurrir al trasporte en autob&uacute;s, de la compa&ntilde;&iacute;a Viazul.</li>\r\n\t<li>Hay autobuses para cubanos, m&aacute;s sencillos, de la compa&ntilde;&iacute;a Astro y se pagan en pesos cubanos.</li>\r\n\t<li>Dado que las carreteras de Cuba est&aacute;n llenas de bicicletas y animales, les recomendamos mucha precauci&oacute;n a la hora de conducir un auto de alquiler y que valoren la conveniencia de usar un auto con conductor.<br />\r\n\t&nbsp;</li>\r\n</ul>
17	Comida en Cuba, qu comer y dnde	4	<ul>\r\n\t<li>Eating in Cuba is very economical. The typical food is called criolla and is a mixture of Spanish and African cuisine. Rice, beans (beans) also called &quot;Moors and Christians&quot; pork (pork), lobster and shrimp (very cheap), sweet potatoes and especially cassava. The yucca with mojo is an exquisite dish.</li>\r\n\t<li>The palates, small restaurants with up to five tables have fallen into disuse due to competition from state restaurants that offer &quot;tables&quot; or &quot;downloads&quot;, attractive and very economical menus.</li>\r\n\t<li>It is cheaper to eat in restaurants and private homes than to buy food in supermarkets and cook, this is because the restaurants buy food in exclusive places for Cubans who charge in pesos, 25 times cheaper than the currency in the What the tourist has to buy is the cuc. That&#39;s why many apartments do not have a kitchen.</li>\r\n</ul>	Food in Cuba, what to eat and where	<ul>\r\n\t<li>Comer en Cuba es muy economico. La comida tipica se llama criolla y es una mezcla de la cocina espa&ntilde;ola y africana. Arroz, frijoles (alubias) tambien llamado &quot;moros y cristianos&quot; el puerco (cerdo), la langosta y los camarones (muy economicos), el boniato y sobre todo la yuca. La yuca con mojo es un plato exquisito.</li>\r\n\t<li>Los paladares, unos peque&ntilde;os restaurantes de hasta cinco mesas han caido en desuso por la competencia de los restaurantes estatales que ofrecen &quot;tables&quot;o &quot;descargas&quot;, unos menus atractivos y muy economicos.</li>\r\n\t<li>Es mas barato comer en restaurantes y en las casas particulares que comprar la comida en los supermercados y cocinar, esto se debe a que los restaurantes adquieren la comida en lugares exclusivos para cubanos que cobran en pesos, 25 veces mas barato que la moneda en la que ha de comprar el turista que es el cuc. Es por eso que muchos apartamentos no tienen cocina.</li>\r\n</ul>
24	Enlaces a Terceros	6	<p>This website may contain links to other sites that may be of interest to you. Once you click on these links and leave our site, we no longer have control over the site to which you are redirected and therefore we are not responsible for the terms or privacy or the protection of your data in those other third party sites. These sites are subject to their own privacy policies, so it is recommended that you check them to confirm that you agree with them.</p>	Links to Third Parties	<p>Este sitio web pudiera contener en laces a otros sitios que pudieran ser de su inter&eacute;s. Una vez que usted de clic en estos enlaces y abandone nuestra p&aacute;gina, ya no tenemos control sobre al sitio al que es redirigido y por lo tanto no somos responsables de los t&eacute;rminos o privacidad ni de la protecci&oacute;n de sus datos en esos otros sitios terceros. Dichos sitios est&aacute;n sujetos a sus propias pol&iacute;ticas de privacidad por lo cual es recomendable que los consulte para confirmar que usted est&aacute; de acuerdo con estas.</p>
25	Control de su informacin personal	6	<p>At any time you may restrict the collection or use of personal information that is provided to our website. Each time you are asked to fill out a form, such as the user registration form, you can check or uncheck the option to receive information by email. In case you have marked the option to receive our newsletter or advertising you can cancel it at any time.</p>\r\n\r\n<p>This company will not sell, assign or distribute personal information that is collected without your consent, unless required by a judge with a court order.</p>\r\n\r\n<p>BookingQBA reserves the right to change the terms of this Privacy Policy at any time.</p>	Control of your personal information	<p>En cualquier momento usted puede restringir la recopilaci&oacute;n o el uso de la informaci&oacute;n personal que es proporcionada a nuestro sitio web.&nbsp; Cada vez que se le solicite rellenar un formulario, como el de alta de usuario, puede marcar o desmarcar la opci&oacute;n de recibir informaci&oacute;n por correo electr&oacute;nico. &nbsp;En caso de que haya marcado la opci&oacute;n de recibir nuestro bolet&iacute;n o publicidad usted puede cancelarla en cualquier momento.</p>\r\n\r\n<p>Esta compa&ntilde;&iacute;a no vender&aacute;, ceder&aacute; ni distribuir&aacute; la informaci&oacute;n personal que es recopilada sin su consentimiento, salvo que sea requerido por un juez con un orden judicial.</p>\r\n\r\n<p>BookingQBA Se reserva el derecho de cambiar los t&eacute;rminos de la presente Pol&iacute;tica de Privacidad en cualquier momento.</p>
6	Cmo recibir a los huspedes?	2	<ol>\r\n\t<li>&quot;There is no second chance to ... give a good welcome&quot;; so this moment is of the utmost importance, as the guest upon your arrival will evaluate if what you announced both of the house and you correspond, if you feel safe, if you inspire confidence. In general, you will make your first impression of your stay with you. Then it&#39;s a good opportunity for you to show off as a good host.</li>\r\n\t<li>It is important that you know in advance the arrival time of your guests. You can previously ask for information about your flight, if you make the first stay in Cuba with you or if you come from another province the approximate arrival time. This allows you to inform you in case you do not reach the estimated time if there was any delay in the flight, etc.</li>\r\n\t<li>It guarantees that everything is clean, organized and that you have the basic elements for your stay such as clean towels and sheets, toilet paper in the bathroom.</li>\r\n\t<li>Receive them personally Show him your house and show off the hospitality of the good Cuban. It also makes clear from the beginning what can and can not be done in the house, so that there are no misunderstandings. It offers optional services such as breakfast, dinners, etc.</li>\r\n</ol>	How to receive guests?	<ol>\r\n\t<li>&ldquo;No hay una segunda oportunidad para&hellip; dar una buena Bienvenida&rdquo;; as&iacute; que este momento es de suma importancia, pues el hu&eacute;sped a su arribo evaluar&aacute; si lo que anunciaste tanto de la casa como de ti se corresponden, si se sentir&aacute; seguro, si le inspiras confianza. En general, har&aacute; su primera impresi&oacute;n de su estancia contigo. Entonces es una buena oportunidad para que hagas gala como buen anfitri&oacute;n.</li>\r\n\t<li>Es importante que conozcan previamente la hora de arribo de tus hu&eacute;spedes. Puedes preguntarles previamente datos de su vuelo, si hacen la primera estancia en Cuba contigo o si vienen de otra provincia la hora de arribo aproximada. Eso te permite informarte en caso de que no llegue a la hora estimada si hubo alg&uacute;n retraso en el vuelo, etc.</li>\r\n\t<li>Garantiza que todo est&eacute;&nbsp;limpio, organizado y que tengas los elementos b&aacute;sicos para su estancia como toallas y s&aacute;banas limpias, papel higi&eacute;nico en el ba&ntilde;o.</li>\r\n\t<li>Rec&iacute;belos personalmente. Mu&eacute;strale tu casa&nbsp;y has gala de la hospitalidad del buen cubano. Tambi&eacute;n deja claro desde el principio qu&eacute;&nbsp;se puede y qu&eacute;&nbsp;no se puede hacer en la casa, para que no haya malentendidos. Ofrece los servicios opcionales como desayuno, cenas, etc.</li>\r\n</ol>
22	Uso de la informacin recogida	6	<p>Our website uses the information in order to provide the best possible service, particularly to maintain a register of users, orders in case it applies and improve our products and services. It is possible that periodic e-mails are sent through our site with special offers, new products and other advertising information that we consider relevant to you or that may benefit you, these e-mails will be sent to the address you provide and may be canceled. anytime.</p>\r\n\r\n<p>BookingQBA is highly committed to fulfill the commitment to keep your information secure. We use the most advanced systems and update them constantly to ensure that there is no unauthorized access.</p>	Use of the information collected	<p>Nuestro sitio web emplea la informaci&oacute;n con el fin de proporcionar el mejor servicio posible, particularmente para mantener un registro de usuarios, de pedidos en caso que aplique y mejorar nuestros productos y servicios. Es posible que sean enviados correos electr&oacute;nicos peri&oacute;dicamente a trav&eacute;s de nuestro sitio con ofertas especiales, nuevos productos y otra informaci&oacute;n publicitaria que consideremos relevante para usted o que pueda brindarle alg&uacute;n beneficio, estos correos electr&oacute;nicos ser&aacute;n enviados a la direcci&oacute;n que usted proporcione y podr&aacute;n ser cancelados en cualquier momento.</p>\r\n\r\n<p>BookingQBA est&aacute; altamente comprometido para cumplir con el compromiso de mantener su informaci&oacute;n segura. Usamos los sistemas m&aacute;s avanzados y los actualizamos constantemente para asegurarnos que no exista ning&uacute;n acceso no autorizado.</p>
2	Qu debe conocer referente al visado?	5	<ol>\r\n\t<li>To travel to Cuba as a pleasure or recreational tourist, you do not need a visa, you will simply need what is called a &quot;tourist card&quot;, which serves as the visa. The same can be obtained at Cuban embassies or consulates as well as travel agencies at the time you purchase your package or otherwise on arrival in Cuba directly at the airport in Cuba. For your request you must fill out the corresponding model, present your current passport, a photocopy of the hotel reservation or other official lodging (the reservation form that we offer to our clients can be used for this purpose, since they have the data of the hostel where will be hosted, which is authorized by the Cuban government to offer this type of rental service) and photocopy of the reservation of the ticket. The tourist card or visa is valid for an entry and exit to Cuba and have a duration of 30 days, from the date of arrival in Cuba, can be extended for another 30 days.</li>\r\n\t<li>To visit Cuban relatives, a visa must be requested for relatives of Cuban citizens, which is issued to foreign direct relatives of Cuban citizens (parents, children, siblings, or spouses) who wish to stay at their relatives&#39; house. To obtain this type of visa you must fill out the corresponding application form and present your current passport.</li>\r\n\t<li>Visas for foreign citizens for non-tourist purposes are issued to foreigners who come to visit Cuba in the nature of events, business offers, crew and transit. Foreign students and scholars admitted in Cuba for a study, research and training center. Journalists, correspondents, representatives of the press, radio, film or television and other foreign media, who are admitted to exercise their journalistic function. Foreigners who wish to undergo medical treatment in Cuban health institutions, prior agreement with the Ministry of Public Health. The visa with commercial and business purpose will be previously managed with the commercial and economic offices of the Embassy.</li>\r\n</ol>	What should you know about the visa?	<ol>\r\n\t<li>Para viajar a Cuba como turista de placer o recreo no se necesita propiamente una visa, simplemente se necesitar&aacute; lo que se denomina una &quot;tarjeta de turista&quot;, la cual hace la funci&oacute;n de la visa. La misma se puede obtener en las embajadas cubanas o consulados as&iacute; como tambi&eacute;n en las agencias de viaje en el momento en que adquiere su paquete tur&iacute;stico o de lo contrario a su arribo a Cuba directamente en el aeropuerto en Cuba. Para su solicitud debe llenar el modelo correspondiente, presentar el pasaporte vigente, una fotocopia de la reservaci&oacute;n de hotel u otro hospedaje oficial (la planilla de reservaci&oacute;n que ofrecemos a nuestros clientes puede ser utilizada con este fin, ya que tienen los datos del hostal donde se hospedara, el cual esta autorizado por el gobierno cubano a ofrecer este tipo de servicio de renta) y fotocopia de la reserva del pasaje. La tarjeta o visa tur&iacute;stica resulta v&aacute;lida para una entrada y salida a Cuba y tienen una duraci&oacute;n de 30 d&iacute;as, a partir de la fecha de llegada a Cuba, puede ser prorrogable por otros 30 d&iacute;as.</li>\r\n\t<li>Para visitar a familiares cubanos, se debe solicitar una visa para familiares de ciudadanos cubanos, la cual se expide a familiares extranjeros directos de ciudadanos cubanos (padres, hijos, hermanos, o c&oacute;nyuges) que deseen hospedarse en casa de sus familiares. Para obtener este tipo de visa deber&aacute; llenar el modelo de solicitud correspondiente y presentar el pasaporte vigente.</li>\r\n\t<li>Las Visas para ciudadanos extranjeros con fines no tur&iacute;sticos se expiden a extranjeros que vienen de visita a Cuba en car&aacute;cter de Eventos, ofertas de negocios, tripulante y tr&aacute;nsito. Estudiantes y becarios extranjeros admitidos en Cuba por un centro de estudio, investigaci&oacute;n y adiestramiento. Periodistas, corresponsales, representantes de la prensa, radio, cine o televisi&oacute;n y otros medios de difusi&oacute;n extranjeros, que sean admitidos para ejercer su funci&oacute;n period&iacute;stica. Extranjeros que deseen someterse a tratamiento m&eacute;dico en instituciones de salud cubana, previa concertaci&oacute;n del mismo con el Ministerio de Salud P&uacute;blica. La visa con prop&oacute;sito comercial y de negocios se gestionar&aacute; previamente con las oficinas comerciales y econ&oacute;micas de la Embajada.</li>\r\n</ol>
10	Aprobacin	1	<p>Once the application has been admitted, the file is filed in the Registry of Applications and immediately the document is prepared: Authorization for Rental of Housing, Rooms and Spaces, (Annex No. 2). The Municipal Director of Housing authorizes and signs said document. The term for the processing and approval of the application is fifteen days from the filing of the file.</p>\r\n\r\n<p>The Municipal Director of Housing does not authorize the registration in the following cases:.</p>\r\n\r\n<p>a) representatives of organizations, firms, entities or foreign countries accredited in the national territory; .</p>\r\n\r\n<p>b) legal persons; Y .</p>\r\n\r\n<p>c) those who have been canceled from the lease and one year has not elapsed since the date of adoption of the cancellation measure. ARTICLE 8.- The owner who decides to rent the house in its entirety and will reside in another place with his family, at the time of making his Affidavit, informs the address of the property where he will reside.</p>	Approval	<p>Admitida la solicitud, se radica el expediente en el Registro de Solicitudes&nbsp;y de inmediato se prepara el documento: Autorizaci&oacute;n para Arrendamiento de Viviendas, Habitaciones y Espacios, (Anexo No. 2). Autoriza y firma dicho documento el Director Municipal de la Vivienda. El t&eacute;rmino para la tramitaci&oacute;n y aprobaci&oacute;n de la solicitud es de quince d&iacute;as contados a partir de la radicaci&oacute;n del expediente.</p>\r\n\r\n<p>El Director Municipal de la Vivienda no autoriza la Inscripci&oacute;n en los siguientes supuestos: .</p>\r\n\r\n<p>a) representantes de organizaciones, firmas, entidades o pa&iacute;ses extranjeros acreditados en el territorio nacional; .</p>\r\n\r\n<p>b) personas jur&iacute;dicas; y .</p>\r\n\r\n<p>c) a los que se les haya cancelado de oficio de arrendamiento y a&uacute;n no ha transcurrido un a&ntilde;o desde la fecha de adopci&oacute;n de la medida de cancelaci&oacute;n. ART&Iacute;CULO 8.- El propietario que decide arrendar la vivienda en su totalidad y va a residir a otro lugar con su n&uacute;cleo familiar, al momento de hacer su Declaraci&oacute;n Jurada, informa la direcci&oacute;n del inmueble donde va a residir.</p>
11	De la inscripcin	1	<p>Approved the request, in the act of its notification, is delivered to the applicant:</p>\r\n\r\n<p>The authorization to purchase the Tenant Registration Book and<br />\r\nThe purchase authorization of badge rental badge sticker (blue logo)<br />\r\nThen go to the National Tax Administration Office for registration in the Taxpayers Registry. Take the corresponding authorization (Annex 2).</p>\r\n\r\n<p>Return to the Municipal Department of Housing with:</p>\r\n\r\n<p>a) Proof of Registration in the Taxpayer Registry granted by the National Tax Administration Office;</p>\r\n\r\n<p>b) stamp stamps for a total value of 100.00 CUC;</p>\r\n\r\n<p>c) The corresponding Tenant Registry Book;</p>\r\n\r\n<p>d) stamp stamps for a total value of five CUP in all cases, for the habilitation of the Books by the designated official; Y</p>\r\n\r\n<p>e) the identification sticker of the authorized lease, which is set at the main entrance of the dwelling object of the lease. The municipal offices of the Housing register the inscription in the Unique Register of Registration of Leases established by the National Institute of Housing.</p>\r\n\r\n<p>Finally, it is delivered:</p>\r\n\r\n<p>1. The document accrediting to exercise the activity of leasing, Registration for the lease of houses, rooms or spaces (Annex No. 3), in original (for Landlord) and copy.</p>\r\n\r\n<p>2. The Tenant Registration Book duly authorized.</p>\r\n\r\n<p>For more details, consult the full document of the Regulation on the lease of houses, rooms and spaces of the National Housing Institute, Resolution 283/2011, from which the information was taken.</p>	From the inscription	<p>Aprobada la solicitud, en el acto de su notificaci&oacute;n, se entrega al solicitante:</p>\r\n\r\n<ol>\r\n\t<li>La autorizaci&oacute;n de compra del Libro de Registro de Arrendatarios y</li>\r\n\t<li>La autorizaci&oacute;n de compra de Pegatina identificativa de arrendamiento en divisa (logo azul)</li>\r\n</ol>\r\n\r\n<p>Despu&eacute;s dirigirse a la Oficina Nacional de Administraci&oacute;n Tributaria para su inscripci&oacute;n en el Registro de Contribuyentes. LLevar la autorizaci&oacute;n correspondiente (Anexo.2).</p>\r\n\r\n<p>Regresar a la Direcci&oacute;n Municipal de la Vivienda con:</p>\r\n\r\n<p>a) el comprobante de Inscripci&oacute;n en el Registro de Contribuyente otorgado por la Oficina Nacional de Administraci&oacute;n Tributaria;</p>\r\n\r\n<p>b) sellos del timbre por valor total de 100.00 CUC;</p>\r\n\r\n<p>c) Libro de Registro de Arrendatarios correspondiente;</p>\r\n\r\n<p>d) sellos del timbre por valor total de cinco CUP en todos los casos, para la habilitaci&oacute;n de los Libros por el funcionario designado; y</p>\r\n\r\n<p>e) la Pegatina identificativa del arrendamiento autorizado, que se fija en la entrada principal de la vivienda objeto del arrendamiento. Las direcciones municipales de la Vivienda registran la inscripci&oacute;n en el Registro &Uacute;nico de Inscripci&oacute;n de Arrendamientos establecido por el Instituto Nacional de la Vivienda.</p>\r\n\r\n<p>Por &uacute;ltimo, se entrega:</p>\r\n\r\n<p>1. El documento acreditativo para ejercer la actividad de arrendamiento, Incripci&oacute;n para el arrendamiento de viviendas, habitaciones o espacios (Anexo No. 3), en original (para Arrendador) y copia.</p>\r\n\r\n<p>2. El Libro de Registro de Arrendatario debidamente habilitado.</p>\r\n\r\n<p><em>Para m&aacute;s detalles consulte el documento &iacute;ntegro del Reglamento sobre arrendamiento de viviendas, habitaciones y espacios del Instituto Nacional de la Vivienda, Resoluci&oacute;n 283/2011 del cual se tom&oacute; la informaci&oacute;n.</em></p>
15	La cultura en Cuba	4	<ul>\r\n\t<li>In spite of the economic deficiencies, in Cuba education is free at all levels and the Cuban people are very cultured and loving of any cultural manifestation. The theater, the opera, the dance, the cinema, are events that many people attend.</li>\r\n\t<li>The Cuban sense of humor is deeply rooted and a constant source of inspiration in any public performance at a caf&eacute; or nightclub.</li>\r\n\t<li>People are very open and it is very common to find on the street anyone with whom a dialogue is established and is an engineer, professor, doctor or simply a cultured person with whom you can engage in a very interesting conversation.</li>\r\n\t<li>Every year, Havana hosts important cultural events, such as the Ibero-American Film Festival, the Book Fair, etc.</li>\r\n\t<li>Transportation in Havana and cities of Cuba: For the tourist, the best way to get around the cities is to take a taxi. They are cheap, depending on which company is chosen. In Havana there are taxis of the state companies &quot;OK&quot; &quot;Panataxi&quot; &quot;F&eacute;nix&quot; &quot;Gaviota&quot; &quot;Gran Car&quot; etc. The most economical and numerous are the &quot;Panataxi&quot;. Lately it is also allowed that autonomous individuals, who in Cuba are called &quot;cuentapropistas&quot; rent their car to tourists, after paying a license. There are community taxis (they operate by journeys picking up the passengers along the way), which cost 10 pesos the way, but they are only for Cubans. For Cubans there are also the yellow and black &quot;Ladas&quot; that have a meter in Cuban pesos. And Cubans move mostly by &quot;bottle&quot; (hitchhiking), with great solidarity. In Havana there are small &quot;cocotaxi&quot;, motorized tricycles, very cheap and also with taximeter, with which the tourist can move. In Cienfuegos and Bayamo, the usual and community taxis are horse-drawn carriages in which the tourist is allowed to get on. They cost one or two pesos to the Cuban and one cuc to the tourist. There are also normal taxis, but these on horseback are very typical. However, in Guanabo it is transportation for Cubans exclusively, so you have to ask in each place the best way to transport yourself.</li>\r\n</ul>	The culture in Cuba	<ul>\r\n\t<li>A pesar de las carencias econ&oacute;micas, en Cuba la educaci&oacute;n es gratuita a todos los niveles y el pueblo cubano es muy culto y amante de cualquier manifestaci&oacute;n cultural. El teatro, la &oacute;pera, la danza, el cine, son eventos a los que acuden muchas personas.</li>\r\n\t<li>El sentido del humor cubano est&aacute; muy arraigado y fuente constante de inspiraci&oacute;n en cualquier actuaci&oacute;n p&uacute;blica en un caf&eacute; o discoteca.</li>\r\n\t<li>La gente es muy abierta y es muy frecuente encontrarte por la calle cualquier persona con la que se establece un di&aacute;logo y es ingeniero, catedr&aacute;tico, m&eacute;dico o simplemente una persona culta con la que se puede entablar una conversaci&oacute;n muy interesante.</li>\r\n\t<li>Todos los a&ntilde;os La Habana es sede de importantes eventos culturales, como el Festival de Cine Iberoamericano, la Feria del Libro, etc.</li>\r\n\t<li>Transporte en La Habana y ciudades de Cuba:&nbsp;Para el turista, lo m&aacute;s adecuado para trasladarse&nbsp;por las ciudades es coger un taxi. Son econ&oacute;micos, seg&uacute;n qu&eacute;&nbsp;compa&ntilde;&iacute;a se escoja.&nbsp;En La Habana hay taxis de las compa&ntilde;&iacute;as estatales &quot;OK&quot; &quot;Panataxi&quot; &quot;F&eacute;nix&quot; &quot;Gaviota&quot; &quot;Gran Car&quot; etc. Los m&aacute;s econ&oacute;micos y numerosos son los &quot;Panataxi&quot;. &Uacute;ltimamente tambi&eacute;n est&aacute;&nbsp;permitido que particulares aut&oacute;nomos, que en Cuba se llaman &quot;cuentapropistas&quot; alquilen su autom&oacute;vil a turistas , previo pago de una licencia. Hay taxis comunitarios (funcionan por trayectos recogiendo a los viajeros a lo largo del camino), que cuestan 10 pesos cubanos el trayecto, pero s&oacute;lo son para cubanos. Para cubanos tambi&eacute;n son los &quot;Ladas&quot; amarillos y negros que tienen tax&iacute;metro en pesos cubanos. Y los cubanos se mueven mayormente haciendo &quot;botella&quot; (autostop), con una gran solidaridad.&nbsp;En La Habana hay unos peque&ntilde;os &quot;cocotaxi&quot;, triciclos con motor, muy econ&oacute;micos y tambi&eacute;n con tax&iacute;metro, con los que puede moverse el turista.&nbsp;En&nbsp;Cienfuegos y Bayamo los taxis habituales y comunitarios son coches de caballos en los que est&aacute;&nbsp;permitido subirse el turista. Cuestan uno o dos pesos al cubano y un cuc al turista. Tambi&eacute;n hay taxis normales, pero estos a caballo son muy t&iacute;picos. Sin embargo en Guanabo es transporte para cubanos exclusivamente, por lo que hay que preguntar en cada lugar la mejor forma de transportarse.</li>\r\n</ul>
4	Por qu hospedarse en un alojamiento privado en Cuba?	2	<p>Although Cuba offers a wide hotel infrastructure with good standards, staying in a private accommodation has the following advantages for vacationers who opt for this option:</p>\r\n\r\n<ol>\r\n\t<li>They can save up to more than 70% of their accommodation budget per night, compared to accommodation in rooms of equal comfort of the hotel offer.</li>\r\n\t<li>You have better chances of knowing an authentic Cuba, knowing the hosts of a Cuban family.</li>\r\n\t<li>Provides privacy, security and flexibility. For most of the Cuban landlords, the rent of their home constitutes their fundamental economic activity and their house their greatest patrimony; so they will do everything possible to guarantee you the best welfare during your stay.</li>\r\n\t<li>You are directly helping a family in Cuba and with great probability you will make new friendships.</li>\r\n</ol>	Why stay in a private rents in Cuba?	<p>Aunque Cuba ofrece una amplia infraestructura hotelera con buenos est&aacute;ndares, alojarse en un hospedaje privado tiene las siguientes ventajas para los vacacionistas que opten por esta opci&oacute;n:</p>\r\n\r\n<ol>\r\n\t<li>Pueden ahorrar hasta m&aacute;s de un 70% de su presupuesto de alojamiento por noche, en comparaci&oacute;n con alojamiento en habitaciones de igual confort de la oferta hotelera.</li>\r\n\t<li>Tienes mejores posibilidades de conocer una Cuba aut&eacute;ntica, conociendo los anfitriones de una familia cubana.</li>\r\n\t<li>Brinda privacidad, seguridad y flexibilidad. Para la mayor&iacute;a de los arrendadores cubanos, el alquiler de su hogar constituye su actividad econ&oacute;mica fundamental y su casa su mayor patromonio;&nbsp;por lo que har&aacute;n todo lo posible por garantizarte el mayor bienestar durante su estancia.</li>\r\n\t<li>Est&aacute;s ayudando directamente a una familia en Cuba y con gran probabilidad har&aacute;s nuevas amistades.</li>\r\n</ol>
3	Otras informaciones importantes	5	<ol>\r\n\t<li>The entry of narcotics, pornography, explosives, firearms is prohibited, except for sports hunting duly authorized in Cuba upon arrival.</li>\r\n\t<li>Personal items, including jewelry, photographic or video cameras, sporting and fishing gear, two bottles of liquor, a carton of cigarettes and up to 22 pounds (10 Kg) of medicines are exempt from taxes, provided they are in its original containers. In addition, items worth up to US $ 250.00 can be imported, of which US $ 50.00 are exempt from payment and the remaining US $ 200.00 are taxed at a 100% duty.</li>\r\n\t<li>The cash inflow is unlimited, but it is recommended to declare figures above 5 000 dollars, since to re-export an amount equal to or greater than that amount, it is required to present the corresponding customs declaration.</li>\r\n\t<li>When leaving the country the free export of up to 50 cigars is allowed (according to Resolution No. 6-2007 effective as of June 1, 2007); If the purchase is more than 50 cigars, they can be exported in their original packaging, sealed and sealed with the official hologram, and the invoice for their purchase must also be presented at an accredited establishment.</li>\r\n\t<li>The extraction of works of art or antiquities from the country must be covered by a permit from the National Registry of Cultural Assets, from the Heritage Directorate of the Ministry of Culture.</li>\r\n\t<li>There are only health restrictions for travelers from countries where yellow fever and cholera are endemic or have been declared areas of infection by the World Health Organization, in which case it is required to present the International Certificate of Vaccination.</li>\r\n\t<li>The entrance of products of animal or vegetable origin is restricted, as well as the entrance of pets requires special procedures.</li>\r\n\t<li>Domestic animals (pets) vaccinated can be imported, but it is necessary to accompany them with the corresponding documentation.</li>\r\n</ol>	Other important information	<ol>\r\n\t<li>Est&aacute; prohibida la entrada de narc&oacute;ticos, pornograf&iacute;a, explosivos, armas de fuego, salvo las de caza deportiva debidamente autorizadas en Cuba a su llegada.</li>\r\n\t<li>Est&aacute;n exentos de impuestos objetos de uso personal incluyendo joyas propias, c&aacute;maras fotogr&aacute;ficas o de video, efectos deportivos y av&iacute;os de pesca, dos botellas de licor, un cart&oacute;n de cigarrillos y hasta 22 libras (10 Kg) de medicamentos, siempre que los mismos est&eacute;n en sus envases originales. Adem&aacute;s pueden importarse art&iacute;culos por un valor de hasta 250.00 d&oacute;lares americanos, de los cuales 50.00 d&oacute;lares est&aacute;n exentos de pago y los restantes 200.00 d&oacute;lares se gravan con un arancel del 100%.</li>\r\n\t<li>La entrada de dinero en efectivo es ilimitada, pero se recomienda declarar cifras por encima de los 5 000 d&oacute;lares, pues para reexportar un monto igual o superior a esa cantidad se exige presentar la declaraci&oacute;n de aduana correspondiente.</li>\r\n\t<li>Al salir del pa&iacute;s se permite la libre exportaci&oacute;n de hasta 50 tabacos habanos (seg&uacute;n la Resoluci&oacute;n No. 6-2007 vigente a partir de Junio 1, 2007); si la compra es de mas de 50 habanos se podr&aacute;n exportar en su envase original, cerrados y sellados con el holograma oficial y adem&aacute;s se deber&aacute; presentar la factura de su compra en un establecimiento acreditado para ello.</li>\r\n\t<li>La extracci&oacute;n del pa&iacute;s de obras de artes o antig&uuml;edades debe estar amparada por un permiso del Registro Nacional de Bienes Culturales, de la Direcci&oacute;n de Patrimonio del Ministerio de Cultura.</li>\r\n\t<li>S&oacute;lo existen restricciones sanitarias para viajeros procedentes de pa&iacute;ses donde la fiebre amarilla y el c&oacute;lera son end&eacute;micos o hayan sido declarados zonas de infecci&oacute;n por la Organizaci&oacute;n Mundial de la Salud, en cuyo caso se exige presentar el Certificado Internacional de Vacunaci&oacute;n.</li>\r\n\t<li>La entrada de productos de origen animal o vegetal est&aacute; restringida, as&iacute; como la entrada de mascotas requiere de tr&aacute;mites especiales.</li>\r\n\t<li>Pueden importarse animales dom&eacute;sticos (mascotas) vacunados, pero es necesario acompa&ntilde;arlo con la documentaci&oacute;n correspondiente.</li>\r\n</ol>
8	Casa particular	1	<ol>\r\n\t<li>&quot;Casa particular&quot; literally means &quot;house&quot;, but it began to be used in the sense of &quot;private accommodation&quot; in 1997, when the Cuban government allowed Cubans to rent rooms in their houses or apartments to tourists; offering Cuban families new sources of income.</li>\r\n\t<li>A private house is basically a private establishment of a Cuban family that offers accommodation service to tourists, so they usually charge very cheap prices. Most of them, in addition to the rental service, offer other services such as dinners, laundry, tour guides, dance classes and Spanish, etc. In general, under this term of &quot;Casa Particular&quot; you can find complete houses, apartments, rooms within a home (shared with a Cuban family), mini-apartments or rooms with independent entrance.</li>\r\n\t<li>The rooms are very clean in general and adapt to tourist standards. The basic accommodation offer is a heated room, with a bed, a wardrobe, a small table and a private bathroom. Other features found may be a telephone, a clock and a television.</li>\r\n\t<li>They usually offer accommodation for no more than 6 people and it is recommended for anyone who wants to stay in a private house during the high season (November - March) to make reservations several weeks in advance. However, outside of the season is not necessary because there are often many of these houses throughout the country and it is enough to book them one week in advance. Prices can go down to 15 euros or even less for longer stays. During the high season they can rise up to around 25 euros. Many of these private homes belong to associations, have a presence on the Web and are promoted in various books and international travel guides.</li>\r\n\t<li>The &quot;Private Houses&quot; can be recognized by a small sign on the door (equal to the logo on the upper left of our website) that the owners get after paying a fixed annual tax per room.</li>\r\n\t<li>In some cities of Cuba and tourist centers such as Varadero, Santa Lucia Beach, Guardalavaca and most of the keys (Santa Maria, Cayo Largo, Cayo Coco, etc.) the Cuban government determined that Private Houses would represent a threat to the hotel industry and some laws and regulations that prohibit the operation of these establishments are approved.</li>\r\n</ol>	Private house	<ul>\r\n\t<li>&quot;Casa particular&quot; significa literalmente &quot;casa&quot;, pero empez&oacute; a ser utilizado en el sentido de &quot;alojamiento privado&quot; en 1997, cuando el gobierno cubano permiti&oacute; a los cubanos alquilar habitaciones en sus casas o apartamentos a los turistas;&nbsp;ofreciendo a las familias cubanas nuevas fuentes de ingresos.</li>\r\n\t<li>Una casa particular es b&aacute;sicamente un establecimiento privado de una familia cubana que ofrece servicio de alojamiento a turistas, por lo que&nbsp;generalmente cobran precios muy econ&oacute;micos La mayor&iacute;a de ellos, adem&aacute;s del servicio de renta, ofrece otros servicios como cenas, lavander&iacute;a, gu&iacute;as tur&iacute;sticos, clases de baile y espa&ntilde;ol, etc. En general bajo este t&eacute;rmino de &ldquo;Casa Particular&rdquo; se pueden encontrar casas completas, apartamentos, habitaciones dentro de un hogar (compartido con una familia cubana), mini-apartamentos o habitaciones con entrada independiente.</li>\r\n\t<li>Las habitaciones son muy limpias en general y se adaptan a las normas tur&iacute;sticas. La oferta b&aacute;sica de alojamiento es una habitaci&oacute;n&nbsp;climatizada, con una cama, un armario, una peque&ntilde;a mesa y un ba&ntilde;o privado. Otras caracter&iacute;sticas encontradas pueden ser un tel&eacute;fono, un reloj y un televisor.</li>\r\n\t<li>Generalmente ofrecen alojamiento para no m&aacute;s de 6 personas y es recomendable para toda persona que desee permanecer en una casa particular durante la temporada alta (noviembre - marzo) hacer reservas con varias semanas de anticipaci&oacute;n. Sin embargo, fuera de la temporada no es necesario porque a menudo hay muchas de esas casas por todo el pa&iacute;s y basta con reservar en ellas con una semana de antelaci&oacute;n. Los precios pueden bajar a 15 euros o incluso menos para estancias m&aacute;s largas. Durante la temporada alta pueden elevarse hasta alrededor de 25 euros. Muchas de estas casas particulares pertenecen a asociaciones, tienen una presencia en la Web&nbsp;y se promocionan en diversos libros y gu&iacute;as de viaje internacionales.</li>\r\n\t<li>Las &ldquo;Casas Particulares&rdquo; pueden ser reconocidas por un peque&ntilde;o signo en la puerta (igual al logotipo en la parte superior izquierda de nuestra Web) que los propietarios obtienen tras el pago de un impuesto anual fijo por habitaci&oacute;n.</li>\r\n\t<li>En algunas ciudades de Cuba y centros tur&iacute;sticos&nbsp;como Varadero, Playa Santa Luc&iacute;a, Guardalavaca&nbsp;y la mayor&iacute;a de los cayos (Santa Mar&iacute;a, Cayo Largo, Cayo Coco, etc.) el gobierno cubano determin&oacute;&nbsp;que las Casas Particulares representar&iacute;an una amenaza para la industria hotelera&nbsp;y se aprueban algunas leyes y reglamentos que proh&iacute;ben la operaci&oacute;n de estos establecimientos.<br />\r\n\t&nbsp;</li>\r\n</ul>
23	Cookies	6	<p>A cookie refers to a file that is sent for the purpose of requesting permission to be stored on your computer, when accepting said file is created and the cookie then serves to have information regarding web traffic, and also facilitates future visits to a website recurrent. Another function that cookies have is that with them the web can recognize you individually and therefore provide you with the best personalized service on your website.</p>\r\n\r\n<p>Our website uses cookies to identify the pages that are visited and their frequency. This information is used only for statistical analysis and then the information is permanently deleted. You can delete cookies at any time from your computer. However, cookies help to provide a better service for websites, you do not give access to information on your computer or you, unless you want it and provide it directly, visits to a website. You can accept or deny the use of cookies, however most browsers automatically accept cookies because it serves to have a better web service. You can also change the configuration of your computer to decline cookies. If you decline, you may not be able to use some of our services.</p>	Cookies	<p>Una cookie se refiere a un fichero que es enviado con la finalidad de solicitar permiso para almacenarse en su ordenador, al aceptar dicho fichero se crea y la cookie sirve entonces para tener informaci&oacute;n respecto al tr&aacute;fico web, y tambi&eacute;n facilita las futuras visitas a una web recurrente. Otra funci&oacute;n que tienen las cookies es que con ellas las web pueden reconocerte individualmente y por tanto brindarte el mejor servicio personalizado de su web.</p>\r\n\r\n<p>Nuestro sitio web emplea las cookies para poder identificar las p&aacute;ginas que son visitadas y su frecuencia. Esta informaci&oacute;n es empleada &uacute;nicamente para an&aacute;lisis estad&iacute;stico y despu&eacute;s la informaci&oacute;n se elimina de forma permanente. Usted puede eliminar las cookies en cualquier momento desde su ordenador. Sin embargo las cookies ayudan a proporcionar un mejor servicio de los sitios web, est&aacute;s no dan acceso a informaci&oacute;n de su ordenador ni de usted, a menos de que usted as&iacute; lo quiera y la proporcione directamente,&nbsp;visitas a una web&nbsp;. Usted puede aceptar o negar el uso de cookies, sin embargo la mayor&iacute;a de navegadores aceptan cookies autom&aacute;ticamente pues sirve para tener un mejor servicio web. Tambi&eacute;n usted puede cambiar la configuraci&oacute;n de su ordenador para declinar las cookies. Si se declinan es posible que no pueda utilizar algunos de nuestros servicios.</p>
\.
